// frontend/src/App.js

import React from 'react';
import './App.css'; // Vamos importar nosso arquivo de estilo

// Este é o nosso componente principal, o App.
// Pense nele como o "corpo" de toda a nossa aplicação.
function App() {
  return (
    <div className="App">
      <header className="app-header">
        <h1>iDoe</h1>
        <nav>
          <a href="#">Anúncios</a>
          <a href="#">Cadastrar</a>
          <a href="#">Login</a>
        </nav>
      </header>

      <main className="app-main">
        <h2>Bem-vindo ao iDoe!</h2>
        <p>A sua plataforma para doar e receber roupas.</p>
      </main>

      <footer className="app-footer">
        <p>&copy; 2025 iDoe - Todos os direitos reservados.</p>
      </footer>
    </div>
  );
}

export default App;
